import './App.css';
import Navbar from './layouts/Navbar';
import Nosotros from './components/Nosotros';
import Medias from './components/Medias';
import Contacto from './components/Contacto';

const App = () => {
  return (
    <>
      <div className="App">
          <Navbar>
            <Nosotros />
            <Contacto />
            <Medias /> 
          </Navbar>
      </div>
    </>
  );
}

export default App;
